// eslint-disable-next-line no-unused-vars
let playerType = 'playerType'
let player = 'x';
export let object = {
    array: [
        {id: 1, name: ''},
        {id: 2, name: ''},
        {id: 3, name: ''},
        {id: 4, name: ''},
        {id: 5, name: ''},
        {id: 6, name: ''},
        {id: 7, name: ''},
        {id: 8, name: ''},
        {id: 9, name: ''}
    ],

    dispatch(action) {
        switch (action.type) {
            case playerType:
                console.log(this.array)
                const element = this.array.find((item) => item.id === action.id);
                element.name = player;
                return this.array;
            default:
                return this.array;
        }
    }
};

// eslint-disable-next-line no-unused-vars
let winPos = [
    [1, 2, 3],
    [4, 5, 6],
    [7, 8, 9],
    [1, 4, 7],
    [2, 5, 8],
    [3, 6, 9],
    [1, 5, 9],
    [3, 5, 7]
];

export const tictacAC = (id) => ({type: playerType, id: id})
